// Single button component
const NumberButton = (props) => {    
    return (
        <input type="button" className="number-button button" value={props.number} />
    );
}

const showNumber = () =>{
    alert("value");
}



// All numbers in Keyboard component from min to max
const Keyboard = (props) => {    
    let numbers = [];
    for(let i = props.max; i >= props.min; i--) {
        numbers.push(i);
    }

    let keyboard = numbers.map(value => {
        return <NumberButton number={value} />
    })
    return (   
        <div className="keyboard-numbers calculator-section">
            {keyboard}
        </div>
    );
}


export default {Keyboard, showNumber};
